// src/components/Skills.js
import React from 'react';


const Skills = () => {
  return (
    <section className="skills-section">
      <h2>Skills</h2>

      <h3>Software Engineering:</h3>
      <div>
        <strong>Tools:</strong> Python, Java, C, SQL, React, Javascript, CSS/HTML, RESTful API, Unix, Linux, GIT
      </div>
      <div>
        <strong>Skills:</strong> Frontend Development, Backend Development, Database Development, Object-Oriented Programming, Software Design, Systems Programming, Unit Testing
      </div>

      <h3>AI/Data Science:</h3>
      <div>
        <strong>Tools:</strong> Python; Pytorch, Tensorflow, Scikit-learn, Keras, Numpy, BeautifulSoup, Selenium
      </div>
      <div>
        <strong>Skills:</strong> AI/Deep Learning/Machine Learning Engineering, Computer Vision Engineering, Neural Networks, Natural Language Processing, Data Preprocessing, Web Crawling
      </div>
    </section>
  );
};

export default Skills;
